pragma solidity ^0.5.12;
pragma experimental ABIEncoderV2;


contract ContentStorage {

    struct ComplexContent
    {
        string[] version;         // 복합컨텐츠의 버전 리스트
        address  uploader;          // 복합컨텐츠 등록자
        string contentType;       // 컨텐츠 유형
        string fileLink;          // 파일 경로
        uint ccidState;   //      // 상태값 - active(0), not active(1), remove(2)
        uint ccidPrice;  //       // 복합컨텐츠의 가격
        uint256 time;            // 블록체인에 등록된 시간
        uint updateTime;
        uint income;             // ccid income
        uint totalIncome;       // total income including all versions
        uint totalLikes;        // totalLikes of the content
        uint countBuyers;           // count number of sold content
        bool isDelete;
        // max is 14 parameters

    }

    // content contract's variable
    mapping (string => ComplexContent) public complexContents;




     // content version struct
    struct Version
    {
        string refCc;               // 복합컨텐츠의 버전 리스트
        address  uploader;            // 복합컨텐츠 등록자
        uint versionState;        // 상태값 - active(0), not active(1), remove(2)
        uint versionPrice;        // 파일 경로
        uint likes;                 // version likes
        uint256 time;                // 블록체인에 등록된 시간
        uint256 updateTime;
        uint income;             // version income
        bool isDelete;
    }
     // indexing to
    mapping (string => Version) public versions;


    // user likes struct
    struct Likes {

        string version;     /// content id
        uint256 time;      // liked time
    }

        // user likes
    mapping(address => Likes[]) public userLikes;

    mapping(address => mapping(string => bool)) public userLikeId;

    mapping (address => uint256) public tokens;




//   event ContentRegist(address indexed user, string ccid, string version, string contentType, uint ccidPrice, uint versionPrice, uint time);

//   event ContentUpdate(address indexed user, string ccid, string version, uint versionPrice, uint time);

  // event ModifyContent(string ccid, uint state, uint price, uint time);
   // event for adding likes
   event LikeAdded(address indexed user, string version, string ccid, uint time);



   // modifier for checking user liked content
  modifier checkUserLike(string memory _version, address sender)
   {
       require(userLikeId[sender][_version] == false);
       _;
   }





  /// registr new content

  function ContentRegist(
      address  sender, string memory _ccid, string memory _version, string memory _contentType,
      string memory _fileLink, uint _ccidState, uint _ccidPrice, uint256 _time,
      string memory _refCc, uint _versionState, uint _versionPrice)
  public returns (bool)
  {

      // add content
      ComplexContent storage content = complexContents[_ccid];
      content.version.push(_version);  // push version to ccid
      content.uploader = sender;   // save msg.sender as a uploader
      content.contentType = _contentType;  // save contentType from ginven content type
      content.fileLink = _fileLink;
      content.ccidPrice = _ccidPrice;
      content.ccidState = _ccidState;
      content.time = _time;
      content.updateTime = _time;
   //   complexContents[_ccid].isDelete = false;       // set inital bool to false
      content.totalLikes = 0;        // set inital likes to zero


      Version storage v = versions[_version];
      //add version of the content
      v.refCc = _refCc;
      v.uploader = sender;
      v.versionState = _versionState;      // set same state with ccid state
      v.versionPrice = _versionPrice;     // set same price with ccid price
      v.likes = 0;      // set inital likes to zero
      v.time = _time;
      v.updateTime = _time;
   //   versions[_version].isDelete = false;

    //  emit ContentRegist(sender, _ccid, _version, _contentType, _ccidPrice, _versionPrice, _time);


      return true;

  }


  // get content
  function getComplexContent(string memory _ccid)
  public view
  returns(ComplexContent memory)
  {
      return complexContents[_ccid];
  }



  // get version of the content
  function getComplexContentVersion(string memory _version)
  public view
  //returns(string memory _referenceId, address uploaderAdr, uint state, uint price, uint likes, uint uploadTime)
  returns(Version memory)
  {
      return versions[_version];
  }

  // get version id by postion
  function  seeVersionPos(string memory _ccid, uint pos)
  public view  returns(string memory version)
  {
      return complexContents[_ccid].version[pos];

  }


//   function getVersion(string memory ccid, uint pos)
//   public view returns(Version memory)
//   {
//       string memory id = seeVersionPos(ccid, pos);
//       return versions[id];

//   }




  function contentUpdate(
      address  sender, string memory _ccid, string memory _version, string memory _referenceId, uint state, uint price, uint modifyTime)

      public returns(bool)
  {

      // add new version to content
      ComplexContent storage content = complexContents[_ccid];
      content.version.push(_version); // push new version to version version array
      content.updateTime = modifyTime;

      // save new version parameters
      Version storage v = versions[_version];
      v.refCc = _referenceId;
      v.uploader = sender;
      v.versionState = state;
      v.versionPrice = price;
      v.likes = 0;  // set inital likes to zero
      v.time = modifyTime;

      //emit ContentUpdate(sender, _ccid, _version, price, modifyTime);
      return true;
  }


 function modifyContent(string memory _ccid, uint _ccidState, uint _ccidPrice, uint _time)
  public returns(bool)
  {
    ComplexContent storage content = complexContents[_ccid];
     content.ccidState = _ccidState;
     content.ccidPrice = _ccidPrice;
     content.updateTime = _time;

     //emit ModifyContent(_ccid, _ccidState, _ccidPrice, _time);
      return true;
  }

  function modifyVersionContent(string memory _version, uint _versionState, uint _versionPrice, uint _time)
  public returns(bool)
  {
      Version storage v = versions[_version];
      v.versionState = _versionState;
      v.versionPrice = _versionPrice;
      v.updateTime = _time;
      return true;
  }




  // remove ccid content
  function removeContent(string memory _ccid, uint _time)
  public
  returns (bool)

  {
     ComplexContent storage content = complexContents[_ccid];
     content.isDelete = true;
     content.ccidState = 2;
     content.updateTime = _time;

    return true;
  }
  // remove version of the content
  function removeVersion(string memory _version, uint _time)
  public

  returns (bool)
  {
      Version storage v = versions[_version];
     //  set isDelete parameter to true;
      v.isDelete = true;
      v.versionState = 2;
      v.updateTime = _time;

      return true;
  }




  // add likes
  function AddLike(address sender, string memory _version, string memory _ccid, uint _time)
  public
  checkUserLike(_version, sender)
  {
    if(sender == versions[_version].uploader) revert("you cannnot like your own contents");
    require(checkVersionExists(_version));
    require(checkContentExists(_ccid));
    userLikes[sender].push(Likes({
        version:_version,
        time : _time
    }));
     userLikeId[sender][_version] = true;
     versions[_version].likes += 1;
     complexContents[_ccid].totalLikes+=1;
     emit LikeAdded(sender, _version, _ccid, _time);

  }


  // get  likes
  function getLikes(string memory _version)
  public view
  returns(uint likes)
  {
      require(checkVersionExists(_version));
      // return total likes of the version
      return(versions[_version].likes);
  }



  // get total likes for content
  function getTotalLikes(string memory _ccid)
  public view
  returns(uint totalLikes)
  {
      require(checkContentExists(_ccid));
      return(complexContents[_ccid].totalLikes);
  }






  // check if content exists
  function checkContentExists(string memory id) public view returns (bool)
  {
      bytes memory fileLink = bytes(complexContents[id].fileLink);  // convert string to bytes and check for existance
      return fileLink.length != 0;
  }



   // check if version exist
  function checkVersionExists(string memory id) public view returns(bool)
  {
    bytes memory refCcid = bytes(versions[id].refCc);         // convert string to bytes and check for existance
      return refCcid.length !=0;
  }


  // check version has inside ccid
  function checkContentVersions(string memory _ccid, string memory _version) public view returns(bool)
  {
      // get length of all uploaded versions
      uint version = complexContents[_ccid].version.length;
        //loop through all uploaded versions for specific ccid
      for(uint i = 0; i< version; i++)
      {
          // convert string to hash and compare two hashes
          if(keccak256(abi.encodePacked(complexContents[_ccid].version[i])) == keccak256(abi.encodePacked(_version)))
             return true;
      }
      return false;
  }


  function onlySeller(string memory contentId, address sender) public view returns(bool)
  {
    return sender == complexContents[contentId].uploader || sender == versions[contentId].uploader;
  }

   function onlyBuyer(string memory contentId, address sender) public view returns(bool)
   {
     return sender != complexContents[contentId].uploader && sender != versions[contentId].uploader;
   }

    function checkPrice(string memory contentId, uint price) public view returns(bool)
    {
      return price == complexContents[contentId].ccidPrice || price == versions[contentId].versionPrice;
    }
}
